import { useEffect, useState } from "react";
import * as React from "react";
import { AppView, Text, Image, StyleSheet } from "react-native";

const Navbar = () => {
    return ( <View>
        <Image
        style={styles.image}
        source={require('../../pics/SpendWell.png')}
      />
        <Text>Im a navbar!!</Text>
    </View> );
}

const styles = StyleSheet.create({
    image: {
        width: 100,
        height: 50,
    },
  });


export default Navbar;
